// frontend/src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

// Import your common components (assuming paths from our structure)
import Navbar from './components/common/Navbar';
import Footer from './components/common/Footer';

// Import your page components (assuming paths from our structure)
import HomePage from './pages/HomePage';
import AboutPage from './pages/AboutPage';
import ProjectsPage from './pages/ProjectsPage';
import ProjectDetail from './components/projects/ProjectDetail'; // Or move to pages/ProjectDetailPage.js
import ContactPage from './pages/ContactPage';
import ResumePage from './pages/ResumePage';
import NotFoundPage from './pages/NotFoundPage';

// Optional: Global App-specific styles (if you have App.css)
// import './assets/styles/App.css';

function App() {
  return (
    <Router>
      <div className="flex flex-col min-h-screen bg-gray-100 text-gray-800"> {/* Example Tailwind classes */}
        <Navbar />
        <main className="flex-grow container mx-auto px-4 py-8">
          <Routes>
            <Route path="/" element={<HomePage />} />
            <Route path="/about" element={<AboutPage />} />
            <Route path="/projects" element={<ProjectsPage />} />
            <Route path="/project/:id" element={<ProjectDetail />} /> {/* Note: Changed to /project/:id for clarity */}
            <Route path="/contact" element={<ContactPage />} />
            <Route path="/resume" element={<ResumePage />} />
            <Route path="*" element={<NotFoundPage />} />
          </Routes>
        </main>
        <Footer />
      </div>
    </Router>
  );
}

export default App;
